fun lengthOfLongestSubstring(s: String): Int {

//    val input = s.toList().map { it.toString() }
//    return solveHelper1(input, input, listOf(), mapOf())

    val input = s.toList().map { it.toString() }.toTypedArray()
    return solveHelper2(s, input, input, arrayOf(), mapOf())
}

private tailrec fun solveHelper2(
    originStr: String,
    origin: Array<String>,
    l: Array<String>,
    acc: Array<String>,
    store: Map<String, Int>
): Int = when {
    origin.isEmpty() || l.isEmpty() -> {
        val tempStore = store.plus(acc.joinToString("") to acc.size)
        tempStore.values.max() ?: 0
    }
    acc.isEmpty() -> solveHelper2(originStr, origin, l.sliceArray(1 until l.size), acc + l.first(), store)
    else -> {
        val head = l.first()
        if (!acc.contains(head)) {
            solveHelper2(originStr, origin, l.sliceArray(1 until l.size), acc + head, store)
        } else {
            val key = acc.joinToString("")
            if (store.containsKey(key)) {
                val distincted = distinct(originStr, key, origin)
                val distinctStr = distincted.first
                val distinctArray = distincted.second

                solveHelper2(distinctStr, distinctArray, distinctArray, arrayOf(), store)
            } else {
                val tempStore = store.plus(acc.joinToString("") to acc.size)
                solveHelper2(originStr, origin.sliceArray(1 until origin.size), origin.sliceArray(1 until origin.size), arrayOf(), tempStore)
            }
        }
    }
}

private fun distinct(originStr: String, key: String, l: Array<String>): Pair<String, Array<String>> {

    var originCopy = originStr

    while (originCopy.startsWith(key)) {
        originCopy = originCopy.substring(key.length, originCopy.length)
    }

    val a = if (originCopy.length != originStr.length)
        key.last() + originCopy
    else
        originCopy

    return originCopy to a.toList().map { it.toString() }.toTypedArray()
}




private fun solveHelper(origin: List<String>, l: List<String>, acc: List<String>, store: HashMap<String, Int>): Int {

    if (origin.isEmpty() || l.isEmpty()) {
        store[acc.joinToString("")] = acc.size
        return store.values.max() ?: 0
    }

    if (acc.isEmpty()) {
        return solveHelper(origin, l.drop(1), acc + l.first(), store)
    }

    val head = l.first()

    if (!acc.contains(head)) {
        return solveHelper(origin, l.drop(1), acc + head, store)
    } else {
        store[acc.joinToString("")] = acc.size
        return solveHelper(origin.drop(1), origin.drop(1), listOf(), store)
    }

}

private tailrec fun solveHelper1(
    origin: List<String>,
    l: List<String>,
    acc: List<String>,
    store: Map<String, Int>
): Int = when {
    origin.isEmpty() || l.isEmpty() -> {
        val tempStore = store.plus(acc.joinToString("") to acc.size)
        tempStore.values.max() ?: 0
    }
    acc.isEmpty() -> solveHelper1(origin, l.drop(1), acc + l.first(), store)
    else -> {
        val head = l.first()
        if (!acc.contains(head)) {
            solveHelper1(origin, l.drop(1), acc + head, store)
        } else {
            val tempStore = store.plus(acc.joinToString("") to acc.size)
            solveHelper1(origin.drop(1), origin.drop(1), listOf(), tempStore)
        }
    }
}



